import React from 'react';
import styles from './index.module.css';

const Text = ({className, color, children, ...rest}) => {
  let classStr = styles.container;
  if(color){
    if(color === "primary"){
      classStr += " "+styles.primary
    }
  }
  console.log("HERE WE GO");
  if(className){
    console.log("HERE WE GO");
    classStr += " "+className
  }
  return(
    <div className={classStr} {...rest}>
      {children}
    </div>
  )
}

export default Text;
